import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Box from '@mui/material/Box';
import { styled } from '@mui/system';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Fade from '@mui/material/Fade';
import { useNavigate } from 'react-router-dom';
import SignUp from '../UserSignUp';
import SignIn from '../UserSignIn';
import HPSignUp from '../HPSignUp';
import HPSignIn from '../HPSignIn';

const PageContainer = styled(Box)({
  background: 'linear-gradient(to right, white, #ab003c)',
  minHeight: '100vh',
  padding: '40px',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  gap: '20px',
  flexWrap: 'wrap',
});

const StyledButton = styled(Button)({
  borderRadius: '35px',
  padding: '20px 20px',
  fontSize: '16px',
  textTransform: 'uppercase',
  letterSpacing: '0.5px',
  border: '1px solid white',
  backgroundColor: 'transparent',
  color: 'white',
  boxShadow: `0 4px 6px 2px rgba(0,0,0,0.08), 0px 2px 4px 0px rgba(0,0,0,0.24), inset 0 -3px 0 0 rgba(0,0,0,0.12)`,
  '&:hover': {
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    border: '1px solid white',
    boxShadow: `0 4px 6px 2px rgba(0,0,0,0.08), 0px 2px 4px 0px rgba(0,0,0,0.24), inset 0 -3px 0 0 rgba(0,0,0,0.12)`,
  },
  '&:active': {
    boxShadow: `inset 0 4px 4px 0 rgba(0,0,0,0.14)`,
  },
});

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <PageContainer>
      <Fade in timeout={2000}>
        <Typography variant="h3" color="white" noWrap>
          Welcome to The Box Office!
        </Typography>
      </Fade>
      <Fade in timeout={5500}>
        <div>
          <StyledButton variant="outlined" onClick={() => navigate('/h-login')}>
            H-Log In
          </StyledButton>
        </div>
      </Fade>
      <Fade in timeout={6000}>
        <div>
          <StyledButton variant="outlined" onClick={() => navigate('/h-signup')}>
            H-Sign Up
          </StyledButton>
        </div>
      </Fade>
      <Fade in timeout={6500}>
        <div>
          <StyledButton variant="outlined" onClick={() => navigate('/p-login')}>
            P-Log In
          </StyledButton>
        </div>
      </Fade>
      <Fade in timeout={7000}>
        <div>
          <StyledButton variant="outlined" onClick={() => navigate('/p-signup')}>
            P-Sign Up
          </StyledButton>
        </div>
      </Fade>
    </PageContainer>
  );
};

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/h-login" element={<HPSignIn />} />
        <Route path="/h-signup" element={<HPSignUp />} />
        <Route path="/p-login" element={<SignIn />} />
        <Route path="/p-signup" element={<SignUp />} />
        <Route path="/" element={<LandingPage />} />
      </Routes>
    </Router>
  );
}

export default App;
